INSERT INTO `cms_module_ecommerce_entries` (`id`, `title`, `description`, `cover`, `inStock`, `timeAdded`, `timeUpdated`, `mediaContent`) VALUES
(1, 'Tsovet ', '<h2><span style="font-size: x-large;">What it is</span></h2>\r\n<p><span style="font-size: x-large;"><strong>Tsovet</strong><strong></strong></span></p>\r\n<p><span style="color: #ff00ff;"><strong><span style="font-size: x-large;">Why we love it</span></strong></span></p>\r\n<p><strong>Aerospace influenced Simplicity. High Design Elements and Lamb Skin Leather Bands, Sophisticated Cool!</strong></p>', '/tmp/uploads/public/next10/tsovetsvtwatch-0002.jpg', '1', 1314049180, NULL, 'a:0:{}'),
(2, 'Moods of Norway', '<h2><span style="font-size: x-large;">What it is</span></h2>\r\n<p><span style="font-size: x-large;"><strong>Moods of Norway </strong></span></p>\r\n<h2><span style="font-size: x-large;">Why we love it</span></h2>\r\n<p><strong>The Story. The Lining. The Fit. The Cut. The Color. The Fun! Showstopper!</strong></p>', '/tmp/uploads/public/next10/iMageWithFallbackAndMagikGUOHCCWV.jpg', '1', 1314049269, NULL, 'a:0:{}'),
(3, 'Daniel Wellington', '<h2><span style="font-size: x-large;">What it is</span></h2>\r\n<p><span style="font-size: x-large;"><strong>Daniel Wellington </strong></span></p>\r\n<p><span style="color: #ff00ff;"><strong><span style="font-size: x-large;">Why we love it</span></strong></span></p>\r\n<p><strong>Round, Clean and Classic lines- Nato Straps. Look great on Men and Women</strong></p>', '/tmp/uploads/public/next10/11006405_966900450001820_8025386386819467387_n.png', '1', 1314049577, NULL, 'a:0:{}'),
(5, 'Kaibosh', '<h2><span style="font-size: x-large;">What it is</span></h2>\r\n<p><strong><span style="font-size: x-large;">Kaibosh</span><br /></strong></p>\r\n<p><span style="color: #ff00ff;"><strong><span style="font-size: x-large;">Why we love it</span></strong></span></p>\r\n<p><strong>Innovative Norwegian Eyewear label with and emphasis on FUN!Designs and Colors</strong>!</p>', '/tmp/uploads/public/next10/Kaibosh-Eyewear-model-04-thumb-307x457-88591.jpg', '1', 1314050443, NULL, 'a:0:{}'),
(6, 'Proof Sunglasses', '<h2><span style="font-size: x-large;">What it is</span></h2>\r\n<p><strong><span style="font-size: x-large;">Proof</span> <br /></strong></p>\r\n<h2><span style="font-size: x-large;">Why we love it</span></h2>\r\n<p><strong>Sustainable wood sunglasses in Bamboo, Ebony and Lace wood. Polycarbonate lenses. 100% UVA and UVB.</strong></p>\r\n<p><strong>Cool retro frames designs, light weight, sustainable wood and 10% of their profits go to corrective eye surgeries in underdeveloped nations.</strong></p>', '/tmp/uploads/public/next10/10968385_844192875644394_3523921292355173875_n.jpg', '1', 1314050985, NULL, 'a:0:{}'),
(7, 'Henry &amp; Belle Denim', '<h2><span style="font-size: x-large;">What it is</span></h2>\r\n<p><span style="font-size: x-large;"><strong>Henry &amp; Belle </strong></span></p>\r\n<p><span style="color: #ff00ff;"><strong><span style="font-size: x-large;">Why we love it</span></strong></span></p>\r\n<p><strong>The Fit, Feel and the&nbsp;Color&nbsp;Wash! The Supima Cotton and Lycra based weaves have a incredible Softness and Comfort</strong></p>\r\n<p><strong>Moss denims and true Indigo lead to perfect coloring! Beauty has never been so effortless.</strong></p>', '/tmp/uploads/public/next10/IMG_5749-820x480.jpg', '1', 1314051093, NULL, 'a:0:{}'),
(8, 'Slate and Stone', '<h2><span style="font-size: x-large;">What it is</span></h2>\r\n<h2><span style="color: #000000; font-size: x-large;"><strong>Slate and Stone</strong></span></h2>\r\n<p><span style="color: #ff00ff;"><strong><span style="font-size: x-large;">Why we love it</span></strong></span></p>\r\n<p><strong>European fabrications with rich texture-heavy fabrics and&nbsp;deep saturated colors.</strong></p>', '/tmp/uploads/public/propaganda images/_MG_8039.jpg', '1', 1314051161, NULL, 'a:0:{}'),
(9, 'LnA', '<h2><span style="font-size: x-large;">What it is</span></h2>\r\n<p><span style="font-size: x-large;"><strong>LnA</strong></span></p>\r\n<h2><span style="font-size: x-large;">Why we love it</span></h2>\r\n<p><span style="font-size: large;">&nbsp;Perfect soft basics with&nbsp;an edge. We love "edge". We love basics. We love LnA.</span></p>', '/tmp/uploads/public/next10/LNA.jpg', '1', 1314051255, NULL, 'a:0:{}'),
(11, 'Super by Retrosuperfuture', '<h2><strong><span style="font-size: x-large;">What it is</span></strong></h2>\r\n<p><span style="font-size: x-large;"><strong>SUPER&nbsp;</strong></span></p>\r\n<p><strong><span style="color: #ff00ff; font-size: x-large;">Why we love it</span><br /></strong></p>\r\n<p><span style="font-size: large;"><strong>Handmade in Italy, Zeiss Lenses, colors and designs that blow the mind!!</strong></span></p>', '/tmp/uploads/public/next10/super-lj9-giaguaro51-01.jpg', '1', 1323087484, NULL, 'a:0:{}'),
(12, 'Oliver Peoples West', '<h2><span style="font-size: x-large;">What it is</span></h2>\r\n<p><strong><span style="font-size: x-large;">Oliver Peoples West</span><br /></strong></p>\r\n<h2>Why we love it</h2>\r\n<p>California Inspired line has incredible Blue Mirrored lenses, Carl Zeiss Polarized Lenses and Sleek Avaitor Style</p>', '/tmp/uploads/public/propaganda images/DE%20ORO%20S-MBU%20MIR%20PLR.jpg', '1', 1323087671, NULL, 'a:0:{}');
