(38, 3, 'Chris', 38, NULL, '10denza Featured on Show-Me St. Louis', '10denza-featured-on-show-me-st.-louis', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0;width:250px;vertical-align:top;text-align:center;" rowspan="3"><img style="margin:5px;" title="Show Me St. Louis" src="/tmp/uploads/public/propaganda%20images/ShowMe.jpg" alt="Show Me St. Louis" width="184" height="200" /></td>\n<td style="border-bottom:1px solid #000;"><strong>10denza featured on Show-Me St. Louis  - CWE Window Walk</strong></td>\n</tr><tr><td style="padding:7px 0;"> </td>\n</tr><tr><td valign="top">10denza and owner Chris Lanter were prominently featured in this recent story on KSDK''s "Show Me St. Louis" about the Central West End''s annual Window Walk. Click <a title="Window Walk on Show Me St. Louis" href="http://www.ksdk.com/news/local/story.aspx?storyid=349867" target="_blank">here</a> to view the video of the segment. Thanks to all who made it out to this great annual event!</td>\n</tr></tbody></table><table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td valign="top"> </td>\n</tr></tbody></table>', 1355262887, 1355262911, NULL, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 148, 0, 0),
(25, 2, 'Dave Edwards', 25, NULL, '10denza in the St. Louis Business Journal', '10denza-in-the-st.-louis-business-journal', '<table style="width: 100%;" border="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td style="padding: 4px 0; width: 250px; vertical-align: top; text-align: center;" rowspan="3"><img src="/tmp/uploads/public/propaganda%20images/biz-journal.jpg" alt="biz journal logo" width="200" height="191" /></td>\r\n<td style="border-bottom: 1px solid #000;"><strong>Music, art and clothing at Central West End''s newest store<br /></strong></td>\r\n</tr>\r\n<tr>\r\n<td style="padding: 7px 0;">E.B. Solomont ~ St. Louis Business Journal</td>\r\n</tr>\r\n<tr>\r\n<td>10denza, which had a soft opening Wednesday, sells clothes and jewelry, but also features a rotating art installation; couches to lounge in; iPod listening stations; an array of cool, sustainable furnishings; and a DJ booth that owner Chris Lanter hopes to use for events.<br /><br />&ldquo;My goal is to bring it all together with a city vibe so people don&rsquo;t necessarily have to drive all over town or get lost in a big box store,&rdquo; Lanter said.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style="color: #ff0000;"><!-- pagebreak --></span></p>\r\n<table style="width: 100%;" border="0">\r\n<tbody>\r\n<tr>\r\n<td style="width: 250px;">&nbsp;</td>\r\n<td>Located at 44 Maryland Plaza, 10denza is planning a grand opening for Sept. 29. Lanter, who worked in transportation logistics for 23 years at his family&rsquo;s company, Lanter Co., said he began hammering out a store concept more than a year ago. He traveled to Chicago, New York, Paris and Miami to explore new concepts. &ldquo;Brick-and-mortar retail needs to provide an experience for the clients with authentic ownership and inspired items that people can&rsquo;t experience from online situations or in a big box,&rdquo; he said.\r\n<p>Designed by St. Louis architects Blair Kweskin and Nick Adams, of Space Architectural Design Studio, 10denza uses repurposed materials from its display cases to its floors. The build-out cost $75,000, Lanter said.</p>\r\n<p>The epoxy stone floor is left over from a previous tenant, Design Within Reach . So are parts of the light fixtures, which were painted slate gray. DWR&rsquo;s display tables were converted by painting them vivid colors, adding casters and topping them with steel-and-glass display cases designed by Space. One side of the 2,300-square-foot store is covered with &ldquo;Greenhaus Cabinets&rdquo; made by the South City-based design shop Mwanzi Co. Constructed with sustainably harvested white oak, they have a modular design.</p>\r\n<p>Certainly, the high-end store fits in with the neighborhood, and Lanter hopes to attract shoppers from Clayton, mid-county and downtown St. Louis. In addition to clothing and jewelry, 10denza has watches, bags, books, art toys and more. The price point for watches ranges from $125 to $575 and up. &ldquo;Fifty percent of inventory will be accessory driven,&rdquo; said Lanter.</p>\r\n<p>Lanter, who declined to disclose start-up costs, said Barbara Archer of Archer Wealth Management helped him to secure a bank loan from PNC . He also put in some of his own equity. Along the way, he was advised by retail consulting firm Management One and worked with retail consultant Sara Hentz to find the space.</p>\r\n<p>&ldquo;10denza is an experience where pop culture, modern city style, music and media converge in one space,&rdquo; Lanter said.</p>\r\n<p>It certainly does.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 1315051913, 1315055130, 1314309600, '0', NULL, '1', '0', '0', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 1071, 0, 0),
(41, 3, 'Chris', 41, NULL, '10denza Presents Apollo Grimm', '10denza-presents-apollo-grimm', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0px;width:250px;text-align:center;vertical-align:top;" rowspan="3">I<img src="/tmp/uploads/public/propaganda%20images/sonnny.jpg" alt="Sonny Hagar" width="231" height="200" /></td>\n<td style="border-bottom-color:#000000;border-bottom-width:1px;border-bottom-style:solid;"><strong>10denza Presents Apollo Grimm- The Modern Renaissance Collection</strong></td>\n</tr><tr><td style="padding:7px 0px;">Friday November 29th, 2013 500-900PM</td>\n</tr><tr><td valign="top">Sonny Hager has always been inspired by Skate Culture and Art, from the Art on the boards to the designs on the  clothing. Recently he noticed a certain predictability and similarity with the clothing lines that he loved while growing up. He felt there was an opportunity to create his own movement and bring "Creative and Inspired Art" back to the spotlight once again. That Vision created Apollo Grimm. We are so pleased to be a part of this launch!<br /><br /> </td>\n</tr></tbody></table><p> </p>\n<table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td valign="top"> </td>\n</tr></tbody></table>', 1385503141, 1385503798, 1385416800, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 498, 0, 0),
(39, 2, 'Dave Edwards', 39, '[propaganda]', '10denza Featured on &quot;Watkins Word&quot; Radio Show', '10denzafeaturedonwatkinsword', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0;width:250px;vertical-align:top;text-align:center;" rowspan="3"><img style="margin:5px;" title="radio mic" src="/tmp/uploads/public/propaganda%20images/radiomic.jpg" alt="Radio mic" width="129" height="200" />Image</td>\n<td style="border-bottom:1px solid #000;"><strong>10denza featured on "Watkins Word" radio show</strong></td>\n</tr><tr><td style="padding:7px 0;"> </td>\n</tr><tr><td valign="top">\n<p>Local attorney Al Watkins recently dropped in to 10denza during a busy holiday shopping weekend and was pleasantly surprised with his experience. He talked about it on his radio show "Watkins Word." You can listen to the segment at the link below. Thanks, Al!</p>\n<p><a title="Watkins Word On Black Friday" href="/tmp/uploads/public/propaganda%20images/watkins.mp3" target="_blank">Listen to the clip</a></p>\n</td>\n</tr></tbody></table><p><span style="color:#ff0000;"><br /></span></p>\n<table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td valign="top"> </td>\n</tr></tbody></table>', 1355314727, 1355503315, 1355176800, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 184, 0, 0),
(11, 2, 'Dave Edwards', 11, NULL, 'Adorn', 'adorn', '<p>• 31 Bits</p>\n<p>• Daniel Wellington</p>\n<p>• Laura Marlow</p>\n<p>• Rockstar in Rome</p>\n<p>• Tsovet</p>\n<p>• Nixon</p>\n<p>• Pura Vida</p>\n<p>• Tat2 Designs</p>\n<p>• We are Owls</p>\n<p> </p>\n<p> </p>\n<p> </p>', 1314187229, 1425948989, NULL, '0', NULL, '1', '0', '0', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', NULL, 'en', 'a:1:{s:4:"ajax";a:2:{s:6:"layout";s:4:"none";s:3:"tpl";s:4:"ajax";}}', 'default', 'default', 3232, 0, 0),
(30, 2, 'Dave Edwards', 30, NULL, 'Alive Magazine - Shop Talk: Fashion Fusion', 'alive-magazine-shop-talk-fashion-fusion', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0;width:250px;vertical-align:top;text-align:center;" rowspan="3"><a title="Alive Magazine PDF of article" href="/tmp/uploads/public/propaganda%20images/alive_mag_Nov_large.pdf" target="_blank"><img style="margin:10px;" src="/tmp/uploads/public/propaganda%20images/alive_mag_Nov_small.jpg" alt="Photo of Alive Magazine article" width="250" height="326" /></a></td>\n<td style="border-bottom:1px solid #000;"><strong>Alive Magazine - Shop Talk: Fashion Fusion</strong></td>\n</tr><tr><td style="padding:7px 0;">By: Gwen Ragno</td>\n</tr><tr><td valign="top">Music and fashion have long since gone hand-in-hand, so when 10denza opened in the Central West End— branding itself as a “retail lounge” with an eclectic selection of clothing, accessories, tech, music and books—the concept seemed both novel and natural. Instead of focusing on any one type of product, the shop is selling a lifestyle: “all the accoutrements of modern city living,” as owner Chris Lanter puts it. Lanter developed the concept after spending time in LA, New York, Miami and Paris, where such lounge-style shops have become quite popular. The key is creating a social experience—making it a place where people like to hang out rather than just exchange goods for tender.</td>\n</tr></tbody></table><p><span style="color:#ff0000;"><!-- pagebreak --></span></p>\n<table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td>\n<p><strong>The Space</strong> is all modular—racks and shelves are on wheels, enabling staff to move things around to keep the space fresh. Chances are, it will look different each time you visit.</p>\n<p><strong>The Music</strong> makes the atmosphere. Five iPod listening stations are loaded with the latest electronica and edgy pop tunes, and the same music plays over the speakers in the store. There’s also a fully-equipped DJ booth in the back, ready for spinning special events and private parties.</p>\n<p><strong>The Goods</strong> run the gamut, from casual-chic tops and dresses and hip sneaker lines like Alife and Pointer to jewelry and watch brands like Tech- nomarine, Meister and Toywatch. There’s also a respectable collection of coffee table books—covering subjects like pop culture, design, graffiti art and music, and personal tech gear like Urbanears headphones and iSkin laptop/tablet bags.</p>\n<p><strong>The art</strong> displayed on the back wall of the shop is not to be skimmed over. At the time this issue went to press, Justin Tolentino, a St. Louis-raised street artist with a bold, energetic style, was on display. Lanter plans to use the space to rotate in other local art and mini installations.</p>\n</td>\n</tr></tbody></table>', 1321603674, 1321643565, 1320098400, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 741, 0, 0),
(43, 3, 'Chris', 43, NULL, 'Alive Magazines Men of Style November 2014', 'alive-magazines-men-of-style-november-2014', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0px;width:250px;text-align:center;vertical-align:top;" rowspan="3"><img src="/tmp/uploads/public/propaganda%20images/AndyCohenCover.jpg" alt="ALive Magazine Nov 2015" width="200" height="262" /></td>\n<td style="border-bottom-color:#000000;border-bottom-width:1px;border-bottom-style:solid;"><strong>Alive Magazine- Men of Style November 2014</strong></td>\n</tr><tr><td style="padding:7px 0px;">Sarah Stallman</td>\n</tr><tr><td valign="top">A liitle bit flashy and a little bit Rock ''n''Roll, 10denza''s Chris Lanter is the living personification of the lifestyle he creates at his hip Central West End boutique. Since 2011, the retail-space-meets-lounge has added a posh twist to the St Louis boutique scene, offereing men''s and women''s clothing accessories and gear. alongside music finds and books. The result is a culmination of years of experience (Lanter is a former DJ) intertwined with the development of his signature style and well-trained eye. He just so happens to represent a portion of his target customer; the fashionable gent with panache. Lanter prefers clothing that fits well and makes him feel confident, attention to detail is key to looking the part. Readily admitting that a man should have '' at least a dozen watches," he favors wristwear from designers like Nixon and MSTR,printed socks and quality eyewear. For Lanter,even one''s choice in cologne is an important piece of the well-dressed puzzle (he wears Tom Ford). Its those fashion-focused details-along boldly printed button-ups, tailored blazers and qulaity denim-that set Lanter apart as both a man of style.and entrepreneur with an air of unconventionality.<br /> </td>\n</tr></tbody></table><p> </p>\n<table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td valign="top"> </td>\n</tr></tbody></table>', 1425586182, 1425586182, 1414792800, '0', NULL, '1', '0', '0', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 25, 0, 0),
(16, 2, 'Dave Edwards', 16, NULL, 'Amuse', 'amuse', '<p>&bull; Kidrobot</p>\r\n<p>&bull; Incase</p>\r\n<p>&bull; Pura Vida</p>\r\n<p>&bull; Frank Kozik</p>\r\n<p>&bull; MAD</p>\r\n<p>&bull; Beast Brothers</p>\r\n<p>&bull; Heidi Kenney</p>', 1314189054, 1315052925, NULL, '0', NULL, '1', '0', '0', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', NULL, 'en', 'a:1:{s:4:"ajax";a:2:{s:6:"layout";s:4:"none";s:3:"tpl";s:4:"ajax";}}', 'default', 'default', 3237, 0, 0),
(29, 2, 'Dave Edwards', 29, NULL, 'Anatomy of a Leather Jacket', 'anatomy-of-a-leather-jacket', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0;width:250px;vertical-align:top;text-align:center;" rowspan="3"><a title="PDF of the anatomy of a perfect leather jacket" href="/tmp/uploads/public/propaganda%20images/Leeather_large.pdf" target="_blank"><img src="/tmp/uploads/public/propaganda%20images/LEATHER.jpg" alt="Small photo of article." width="216" height="270" /></a></td>\n<td style="border-bottom:1px solid #000;"><strong>The Anatomy of a Leather Jacket</strong></td>\n</tr><tr><td style="padding:7px 0;">By: Suzy Bacino</td>\n</tr><tr><td valign="top">Form. Function. Fashion. A perfect leather jacket is a wardrobe staple – and essential for fall weather. Click the thumbnail image to check out the anatomy of the perfect leather jacket.</td>\n</tr></tbody></table><table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td> </td>\n</tr></tbody></table>', 1321602551, 1321643546, 1318370400, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 73, 0, 0),
(42, 3, 'Chris', 42, NULL, 'Best Clothing Store for Men St Louis 2014', 'best-clothing-store-for-men-st-louis-2014', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0px;width:250px;text-align:center;vertical-align:top;" rowspan="3"><img src="/tmp/uploads/public/propaganda%20images/4587c396e73aad86bfb4eaea83e08a4b_400x400.jpg" alt="RFT LOGO1" width="200" height="200" /></td>\n<td style="border-bottom-color:#000000;border-bottom-width:1px;border-bottom-style:solid;"><strong>Best Clothing Store For Men St Louis 2014</strong></td>\n</tr><tr><td style="padding:7px 0px;">Riverfront Times</td>\n</tr><tr><td valign="top">Are you tired of looking like a schlubby Cardinals fan with a hangover? Even if that''s what you are.it doesn''t mean you have to look like it. Head over to 10denza and replace your soiled Molina jersey with button-up shirts, designer jeans, stylish shoes and accessories to compliment your look. The name comes from the Italian word "tendenza" meaning "trending" and that''s exactly whats happening at the Central West End Boutique. Owner Chris Lanter stocks brands like Descendant of Thieves and Moods of Norway. Sure, they sound like pretentious inie-rock bands,but they''ll make you seem like you just got back from an A-list party in Amsterdam. In fact, 10denza stocks shirts from Amsterdam-based Scotch &amp; Soda, so coolness is pracctically gauranteed. But because 10denza carries designer duds doesn''t mean you have to have a yacht in Sanit-Tropez to shop there. Prices range from $50 for shirts to $500 for suits. And if your beer-slinging buddies try to poke fun because you want to look like and adult, just show them the inside of your Moods of Norway sports coat- the patch says "Made with love by really really pretty blonde girls" <br /><br /></td>\n</tr></tbody></table><p> </p>\n<table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td valign="top"> </td>\n</tr></tbody></table>', 1425582540, 1425582862, 1412114400, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 26, 0, 0),
(36, 2, 'Dave Edwards', 36, NULL, 'Black Friday/Small Business Saturday at 10denza', 'black-friday/small-business-saturday-at-10denza', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0;width:250px;vertical-align:top;text-align:center;" rowspan="3"><img src="/tmp/uploads/public/propaganda%20images/AMEX_Shop_Small_Street_RGB_GRAD_Logo.jpg" alt="AMEX logo" width="198" height="198" /></td>\n<td style="border-bottom:1px solid #000;"><strong>Shop Small, Not Mall this Holiday Weekend!</strong></td>\n</tr><tr><td style="padding:7px 0;"> </td>\n</tr><tr><td valign="top">Sleep in and avoid the lines, hassles and stress of big box holiday shopping. Instead, drop by 10denza to find unique, stylish and cool gifts in a "chill" atmosphere. We''re offering 20% off all regularly priced merchandise on Black Friday and Small Business Saturday, as well as alredy great deals on sale items. Let the Style Arbiters of team 10denza set you up with the latest holiday one-of-a-kinds in:</td>\n</tr></tbody></table><p><span style="color:#ff0000;"><!-- pagebreak --></span></p>\n<table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td valign="top">- Clothing<br />- Accessories<br />- Gifts<br />- Shoes<br />- Books<br />- Music<br />- Jewelry\n<p>Featuring designers and collections not found elsewhere in St. Louis.</p>\n<p>Happy Thanksgiving to all of our loyal customers and friends. We hope to see you this weekend!</p>\n</td>\n</tr></tbody></table>', 1353527071, 1353571674, 1353448800, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 718, 0, 0),
