(35, 2, 'Dave Edwards', 35, NULL, 'Introducing adidas SLVR sportswear - only at 10denza', 'introducing-adidas-slvr-sportswear-only-at-10denza', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0;width:250px;vertical-align:top;text-align:center;" rowspan="3"><img src="/tmp/uploads/public/propaganda%20images/SLVR%20Photo.jpg" alt="Image of Adidas clothing" width="200" height="131" /></td>\n<td style="border-bottom:1px solid #000;"><strong>Introducing adidas SLVR sportswear - only at 10denza</strong></td>\n</tr><tr><td style="padding:7px 0;"> </td>\n</tr><tr><td valign="top">The future is not only bright – it’s smart, sleek, and effortlessly chic. For Autumn/Winter 2012, SLVR, the sexy new line for men and women by adidas, mines for inspiration the classic silent film Metropolis, crafting a bold, futuristic collection of contemporary sportswear essentials. 10denza is the exclusive retailer of SLVR in St. Louis.</td>\n</tr></tbody></table><p><!-- pagebreak --></p>\n<table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td valign="top">\n<p>Under the creative direction of Dirk Schönberger, adidas SLVR continues to evolve its high-fashion perspective, combining precision tailoring with breakthrough fabrics and a sport attitude. “SLVR relies on the technical excellence of adidas while pushing the limits of sportswear,” explains Schönberger. “It’s about staying open to new concepts and ideas. The fusion of tailoring and sportswear creates something that I believe is very relevant to culture right now.”</p>\n<p><a href="http://slvrstore.adidas.com/" target="_blank">Take a sneak peak here</a>, then stop into 10denza at 44 Maryland Plaza in the Central West End to experience the new SLVR line up close.</p>\n</td>\n</tr></tbody></table>', 1347574999, 1347577002, 1347487200, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 708, 0, 0),
(15, 2, 'Dave Edwards', 15, NULL, 'Listen', 'listen', '<p>• Urbanears</p>\n<p>• AIAIAI</p>\n<p>• Sol Republic</p>\n<p>• Nixon</p>', 1314188797, 1383335872, NULL, '0', NULL, '1', '0', '0', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', NULL, 'en', 'a:1:{s:4:"ajax";a:2:{s:6:"layout";s:4:"none";s:3:"tpl";s:4:"ajax";}}', 'default', 'default', 2635, 0, 0),
(40, 4, 'Kerrie', 40, NULL, 'Local Social Special Exhibit: Illustrative Works by Hannah Smith', 'local-social-special-exhibit-illustrative-works-by-hannah-smith', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0;width:250px;vertical-align:top;text-align:center;" rowspan="3"><img title="An Exhibition of Illustrative Works by Hannah Smith" src="/tmp/uploads/public/propaganda%20images/10denza%20Flyer%20final%20edit.jpg" alt="Hannah Smith Exhibit Flyer" width="200" height="136" /></td>\n<td style="border-bottom:1px solid #000;"><strong>Local Social Special Exhibit: Illustrative Works by Hannah Smith</strong></td>\n</tr><tr><td style="padding:7px 0;">Join us!</td>\n</tr><tr><td valign="top">\n<p>10denza is proud to present an Exhibition of Illustrative Works by local Saint Louis artist, Hannah Smith. Drawing from childhood dreams, Smith''s work contains the inventive, the imaginative, and the otherworldly.</p>\n<p><strong>Friday, September 13 from 5-9 p.m. at 10denza</strong></p>\n<p><em>Cocktails from American Harvest Organic Spirit</em><br /><br /><strong><a title="Hannah Smith Exhibit" href="https://www.facebook.com/events/593277080730021/" target="_blank">Click here and let us know if you can make it &gt;&gt;</a></strong></p>\n</td>\n</tr></tbody></table><p> </p>\n<table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td valign="top"> </td>\n</tr></tbody></table>', 1378768854, 1378769130, NULL, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 538, 0, 0),
(28, 2, 'Dave Edwards', 28, '[propaganda]', 'Mini Pink Book : Concept to Reality', 'mini-pink-book-concept-to-reality', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0pt;width:250px;vertical-align:top;text-align:center;" rowspan="3"><img src="/tmp/uploads/public/propaganda%20images/NicoleBenoist.jpg" alt="photo of Nicole Benoist for Mini Pink Book" width="200" height="251" /></td>\n<td style="border-bottom:1px solid #000000;"><strong>Concept to Reality: 10denza in the Central West End</strong></td>\n</tr><tr><td style="padding:7px 0pt;">Nicole Benoist</td>\n</tr><tr><td>\n<p>My latest obsession is an über cool concept boutique in St. Louis. Chris Lanter recently opened the doors of 10Denza, a hip spot in the heart of the Central West End. He’s managed to create an inviting retail space with an eclectic range of must-haves for both gals and guys.<br /><br />I first fell in the love with the idea of a concept store nearly ten years ago when I visited Colette in Paris—leave it to the French to figure out how to merchandise a Fendi dress next to a Bic lighter. This kind of retail venture is tough to pull off—it’s an art to edit down a world of products into a cohesive and cool selection.<br /><br />On this continent, 10Denza does it well. You’ll find handmade Contego sunglasses, Digby &amp; Iona jewelry, the latest album from Lenka, clothing from Maison Scotch, bike lights from Stockholm-based brand Bookman and a great range of fashion books.</p>\n<p>Check out: <span style="color:#ff00ff;"><a title="Mini Pink Book URL" href="http://www.minipinkbook.com"><span style="color:#ff00ff;">http://www.minipinkbook.com</span></a></span></p>\n</td>\n</tr></tbody></table><table style="width:849px;height:21px;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td> </td>\n</tr></tbody></table>', 1318246560, 1318247101, 1316988000, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 252, 0, 0),
(34, 3, 'Chris', 34, NULL, 'Moods of Norway Menswear Arrives at 10denza', 'moods-of-norway-menswear-arrives-at-10denza', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0;width:250px;vertical-align:top;text-align:center;" rowspan="3"><br /><img style="float:left;margin:10px;" title="Moods of Norway" src="/tmp/uploads/public/propaganda%20images/foto_ole_musken_ss11_11-1.jpg" alt="Moods of Norway" width="320" height="214" /></td>\n<td style="border-bottom:1px solid #000;"><strong>Moods of Norway Arrives at 10denza</strong></td>\n</tr><tr><td style="padding:7px 0;"> </td>\n</tr><tr><td valign="top">\n<p>10denza is thrilled to announce the arrival of Moods of Norway to St Louis and is proud to be the exclusive local retailer of this unique and colorful clothing line.</p>\n<p>In the picturesque town of Stryn, Norway, two local designers, Simen Staalnacke and Peder Børresen, gave birth to a concept soon to be known, worn, and adorned, as The Moods of Norway. The duo met up with third designer, Stefan Dahlkvist and drew their lines for the coming collections. The brand has its headquarters and showroom in the town of Stryn.</p>\n<p> </p>\n</td>\n</tr></tbody></table><p><span style="color:#ff0000;"><!-- pagebreak --></span></p>\n<table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td valign="top">The Moods of Norway line is made of the finest fabrics with superior quality in bold colors and with an offbeat sense of humor and style. The designers say their goal is to "make happy clothes for happy people around the world." 10denza is happy to introduce this line to fashion-forward men throughout the St. Louis area.\n<p>We hope you will drop by the store and experience this exceptional line of menswear in person!</p>\n</td>\n</tr></tbody></table>', 1334330123, 1334331148, 1334268000, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 979, 0, 0),
(8, 1, 'Support Account', 8, NULL, 'Next 10', 'next10', '<p><a href="#">Located</a> in the heart of the Central West End 10denza is the blend of art and fashion.</p>', 1314052044, 1315481717, NULL, '0', NULL, '1', '0', '0', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', NULL, 'en', 'a:0:{}', 'ecommerce', 'default', 26162, 0, 0),
(27, 2, 'Dave Edwards', 27, NULL, 'Nicki&#039;s Central West End Guide', 'nickis-central-west-end-guide', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0;width:250px;vertical-align:top;text-align:center;" rowspan="3"><img style="margin-left:10px;margin-right:10px;" src="/tmp/uploads/public/propaganda%20images/nickis.jpg" alt="interior of store" width="200" height="191" /></td>\n<td style="border-bottom:1px solid #000;"><strong>What''s 10denza?</strong></td>\n</tr><tr><td style="padding:7px 0;">Nicki ~ Online Blog</td>\n</tr><tr><td>\n<p>Ultra-hip 10denza (from the Italian tendenza meaning "following a trend") opened the middle of September at 44 Maryland Plaza in the space formerly occupied by Design Within Reach. The often-heard assumption that shopping on Maryland Plaza is somewhat exclusive and expensive will be blown away when you enter this urban emporium. Chris Lanter, below, the creator and "arbiter" (as he identifies himself on his business card), has been observing the commercial real estate market in the CWE for a couple of years, waiting for the right space to become available. An aficionado of pop culture and current trends, Chris knew that this eclectic neighborhood was the only place in town where his vision of a shop would fit.</p>\n<p>Check out Nicki''s Blog: <span style="color:#ff00ff;"><a title="Nicki''s Blog" href="http://nickidwyer.typepad.com/"><span style="color:#ff00ff;">http://nickidwyer.typepad.com/</span></a></span></p>\n</td>\n</tr></tbody></table><p><!-- pagebreak --></p>\n<table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td>\n<p> </p>\n<p>Chris started working as a d.j. while in college and for a time afterwards. So, naturally, one of the first things you''ll notice when you walk into 10denza is the music playing in the background. There are 5 ipod listening stations where you can preview a wide variety of music available for purchase. Chris avidly reads music reviews and listens to new artists to introduce. He offers new releases featuring imports from Europe, D.J. mixes, alternative, and electronic music, $13 to $19.</p>\n<p>There are a few tables containing a large selection of coffee table books on art, design, music, pop culture, and as Chris said, "street stuff," $20 to $50. I was told the books are meant to be handled, and there are comfortable chairs, below, to sit and peruse.</p>\n<p>10denza has a "no pressure" staff--Kerrie Knoll &amp; Darren Compton (not photographed)--who add to the very relaxed vibe, and the shop stocks a wide range of merchandise you won''t find elsewhere, $5 to $800.</p>\n<p>There is a display wall with shoes for women, left, and men, below, in casual and sneaker style.</p>\n<p>Brands include Puma, Pointer, and ALife, $55 to $160.</p>\n<p>There is jewelry too, including this set, shown left, from Brooklyn-based designers Digby &amp; Iona.</p>\n<p>10denza carries casual, comfortable clothing for men and women ranging from "arty" t-shirts starting at $30 on up to jackets at $700.</p>\n<p>Chris also supports local designers, stocking clothing from Vintage Highway and CWEnder Amy Johnson, who designs under the name of Kay-oss. Amy''s adorable skirt, right, is $190, and in the shop window you''ll see one of her great black dresses with tiny ruffles on the cuffs. I watched three of them get snapped up on as many visits.</p>\n<p>Personal tech gear includes ipad covers above, $29.95, headphones, and other tech accessories. A new shipment of winter clothing including mittens right, $25, and unusual knit hats upper right, $45, is now on the shelves.</p>\n<p>Brightly-colored TOY watches, above, come in "jellys," $160, or "velvety," $225 (not shown). 10denza also carries sunglasses, $100, from a philanthropic Brooklyn company named Contego, that sends a pair to a charity with each purchase. The glasses are named after Nobel Laureates.</p>\n<p>Chris''s 10 year-old daughter, Olivia, and 13 year-old son, Blaise, help with merchandising decisions. Blaise, who knows a lot about what''s hip in toyland, suggested the Kid Robot collection, toys designed by different artists. Toys range in price from $5 up to $200, some of which are shown in the glass jars on the counter above.</p>\n<p>Toygiants by Daniel &amp; Geo Fuchs is an illustrated journey into the world of toys, right.</p>\n<p>You too should follow the trend and stop by 10denza when you have some time to browse, enjoy the music, and the company. The shop is a wonderful addition and such an enjoyable experience.</p>\n<p>10denza is located at 44 Maryland Plaza<br />12 to 8 Monday - Saturday, 12 to 5 Sunday, (314) 361-1010.</p>\n</td>\n</tr></tbody></table><p> </p>', 1317733405, 1318247347, 1317592800, '0', NULL, '1', '0', '0', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 788, 0, 0),
