(18, 1, 'Support Account', 18, NULL, 'Become a member', 'signup', '<p>&nbsp;</p>\r\n<table id="signup" border="0">\r\n<tbody>\r\n<tr>\r\n<td class="first">\r\n<div><strong>Sign up to be notified about:</strong>\r\n<p>// Events<br />// New Products<br />// Special Offers</p>\r\n</div>\r\n</td>\r\n<td class="second"><form method="post"><input type="hidden" name="" value="" />\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td class="text"><input class="text" type="text" /><kbd>Your email address</kbd></td>\r\n<td class="submit"><input type="image" src="/htdocs/images/blank.gif" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</form></td>\r\n</tr>\r\n</tbody>\r\n</table>', 1314996808, 1315052794, NULL, '0', NULL, '1', '0', '0', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', NULL, 'en', 'a:1:{s:4:"ajax";a:2:{s:6:"layout";s:4:"none";s:3:"tpl";s:4:"ajax";}}', 'default', 'default', 3350, 0, 0),
(32, 2, 'Dave Edwards', 32, NULL, 'Special Exhibit: Empty City, Posters by Potter', 'special-exhibit-empty-city-posters-by-potter', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0;width:250px;vertical-align:top;text-align:center;" rowspan="3"><img src="/tmp/uploads/public/propaganda%20images/Empty_City_Poster.jpg" alt="Graphic of the poster by potter special exhibit" width="180" height="245" /></td>\n<td style="border-bottom:1px solid #000;"><strong>Special Exhibit: Empty City, Posters by Potter</strong></td>\n</tr><tr><td style="padding:7px 0;">You are invited!</td>\n</tr><tr><td valign="top">\n<p>10denza, the Central West End''s hot new "retail lounge" is proud to present a special exhibit: Empty City, Posters by Potter, featuring the work of local rock poster artist and musician Jason Potter, known for his hand-screen printed rock show posters for various national and local bands and as the drummer in St. Louis bands Left Arm and Bruiser Queen.<br /><br /><span style="text-decoration:underline;">This <strong>free</strong> exhibit kicks off with an opening reception on:</span><br /><strong>Friday, January 27 from 7-10 p.m.at 10denza</strong></p>\n•  Hors d''oeuvres and cocktails<br />•  Music by DJ Ryan Snowden and Bruiser Queen<br />•  Poster signings by the artist<br /><br /><p><a href="http://www.facebook.com/10denza?sk=events" target="_blank">Click here and let us know if you can make it &gt;&gt;</a></p>\n</td>\n</tr></tbody></table><p> </p>\n<table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td valign="top"> </td>\n</tr></tbody></table>', 1325769465, 1325770239, 1325714400, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 127, 0, 0),
(31, 2, 'Dave Edwards', 31, NULL, 'Stlmag: Shop Talk - Coolness Rising', 'stlmag-shop-talk-coolness-rising', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0;width:250px;vertical-align:top;text-align:center;" rowspan="3"><a title="PDF of stl mag article" href="/tmp/uploads/public/propaganda%20images/StlMag_Nov_2011_Large.pdf" target="_blank"><img src="/tmp/uploads/public/propaganda%20images/StlMag_Nov_2011_Small.jpg" alt="PDF of Stl Mag article" width="180" height="245" /></a></td>\n<td style="border-bottom:1px solid #000;"><strong>Stlmag - Shop Talk : Coolness Rising</strong></td>\n</tr><tr><td style="padding:7px 0;">By: Rosalind Early</td>\n</tr><tr><td valign="top">\n<p>At 10denza, the hip factor is all in the details. The new Central West End boutique sells watches from TechnoMarine and ToyWatch, sunglasses from Mosley Tribes and Dita, and ALFIE and Puma shoes. Beyond cloths and accessories, the store carries books, music, and artwork from painters like local graffiti artist Justin Tolentino. Boutique owner Chris Lanter concived the store as a "retail lounge"–complete with an iPod listening station loaded with imports and DJ mixes as well as a DJ booth.</p>\n<p>Click on the thumbnail image to read the full article.</p>\n</td>\n</tr></tbody></table><p><span style="color:#ff0000;">\\</span></p>\n<table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td> </td>\n</tr></tbody></table>', 1321605345, 1321643651, 1320098400, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 111, 0, 0),
(6, 1, 'Support Account', 6, NULL, 'Story', 'story', '<table border="0" cellspacing="3" cellpadding="5" align="center">\r\n<tbody>\r\n<tr>\r\n<td style="vertical-align: top;"><img style="display: block; margin-left: auto; margin-right: auto;" src="/tmp/uploads/public/Story%20images/story_image.jpg" alt="interior images of 10denza" width="200" height="648" />&nbsp;</td>\r\n<td style="padding: 10px;" rowspan="3">\r\n<p>In Italian, 10denza (or tendenza) means &ldquo;trending&rdquo; or &ldquo;to drift in a direction.&rdquo;</p>\r\n<p>Like most people, I love to find out what is new and happening in my city - restaurants, bars, nightclubs, shops, music. It is especially exciting when local entrepreneurs put out amazing new experiences for the people of St. Louis. Don&rsquo;t we all like to brag to folks from out of town about all of the unique and special places that our city has to offer? It gives us a sense of pride.</p>\r\n<p>This feeling, in part, was what led me to the development of 10denza. I spent some time in 2009 traveling to other cities and seeing some of the new concepts that creative business people were unveiling in the marketplace, especially in retail, and I was cognizant of the growing decrease of local visions and ideas in many cities I visited.</p>\r\n<p>I had a vision of creating a store that caters to city clientele, bringing together all of the stuff that is interesting, fun, new and exciting in one place. Today&rsquo;s city dweller leads an exciting and active life beyond uniformed stores and boring shopping malls. They appreciate the social element and cultural connection of a shopping experience as well and gravitate toward merchants who enrich their lives in some way.</p>\r\n<p>While I was working on the concept, I thought about how much I love big city restaurants and lounges and the comfortable feeling l have when I''m in those spaces, particularly the ones that have the perfect combination of great service, great sound and interesting d&eacute;cor - relaxing and cool. Those attributes help create the overall experience, and I wanted to throw some of that feeling into the 10denza mix as well - kind of a "retail lounge."</p>\r\n<p>I created 10denza to bring innovation and distinction to the city shopping experience. It goes beyond the common exchange of goods. My goal is to provide my customers with inspiring retail, authentic ownership and approachable price points in a great space and deliver a unique representation of trend forward, hard to find products that define modern cultural living. I hope you like it.<br /><br /><br /><img src="/tmp/uploads/public/next10/chris_lanter.jpg" alt="Chris Lanter''s Signature" width="165" height="107" /><br /><br />Chris Lanter<br />Arbiter&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 1313321892, 1315083197, NULL, '0', NULL, '1', '0', '0', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', NULL, 'en', 'a:0:{}', 'white-area', 'default', 11694, 0, 0),
