(1, 1, 'Support Account', 1, NULL, 'Document not found', 'system/404', '<p><strong>404</strong></p>', 1297525395, 1297525645, NULL, '1', NULL, '1', '0', '0', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:17:"noindex, nofollow";s:6:"author";s:0:"";}', '[system]', 'en', 'a:1:{s:6:"header";a:1:{s:4:"code";s:3:"404";}}', 'status', 'default', 10680, 0, 0),
(2, 1, 'Support Account', 2, NULL, 'Login', 'system/admin', '<p>{module name:"auth" action:"form"}</p>', 1297525395, 1297525616, NULL, '1', NULL, '1', '0', '0', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:17:"noindex, nofollow";s:6:"author";s:0:"";}', '[system]', 'en', 'a:0:{}', 'default', 'default', 483, 0, 0),
(33, 2, 'Dave Edwards', 33, NULL, 'Tech Dweller&#039;s Dream: 10denza', 'tech-dwellers-dream-10denza', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0;width:250px;vertical-align:top;text-align:center;" rowspan="3"><img style="float:left;margin-left:20px;margin-right:20px;" src="/tmp/uploads/public/propaganda%20images/sunnies_stilettos.jpg" alt="Small image of the Sunnies + Stilettos" width="234" height="297" /></td>\n<td style="border-bottom:1px solid #000;"><strong>Tech Dweller''s Dream: 10denza<br /></strong></td>\n</tr><tr><td style="padding:7px 0;">Sarah King : Sunnies + Stilettos</td>\n</tr><tr><td valign="top">\n<p>Last Saturday my hubby and I had a rare opportunity to do a little shopping and lunch in the Central West End…one of my favorite areas of St. Louis. We popped into the newest concept store to hit the Lou opened by former logistics mogul, Chris Lanter. We were immediately greeted by Chris and his lovely staff who all eagerly started chatting up new products and telling the story of what makes 10denza so special. Offering an array of tech gear, interesting table-top books, hard-to-find fashion and photography magazines, sneakers, men’s and women’s clothing, sunnies (yes I walked out with a bad-ass pair of cat eye DITA’s), and many other exciting gadgets and accessories all creatively displayed in a retail lounge environment. Why the name you ask?</p>\n<p><span style="color:#ff00ff;"><a href="http://sunniesandstilettos.com/2012/03/01/tech-dwellers-dream-10denza/" target="_blank"><span style="color:#ff00ff;">Full Article &amp; Pics  &gt;&gt;<br /></span></a></span></p>\n</td>\n</tr></tbody></table><p> </p>\n<table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td valign="top"> </td>\n</tr></tbody></table>', 1333578083, 1333579282, 1330552800, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 293, 0, 0);
