(26, 2, 'Dave Edwards', 26, NULL, 'The Riverfront Times', 'the-riverfront-times', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0;width:250px;vertical-align:top;text-align:center;" rowspan="3"><img style="vertical-align:middle;" src="/tmp/uploads/public/propaganda%20images/rft_logo.jpg" alt="River Front Times logo" width="200" height="159" /></td>\n<td style="border-bottom:1px solid #000;"><strong>10denza Now Open in the Central West End</strong></td>\n</tr><tr><td style="padding:7px 0;">Julia Gabbert</td>\n</tr><tr><td>The Central West End gained a trendy new shop with the arrival of 10denza. Located at 44 Maryland Plaza, right in front of the fountain, 10denza opened its doors August 24 in the spot formerly occupied by Design Within Reach with owner Chris Lanter, 48, at the helm.<br /><br />"I''ve always loved music and pop culture and style," Lanter said. "I wanted to bring a new experience to shopping in St. Louis. We wanted to provide an opportunity for shoppers to come to one place and find a selection of things -- accessories, shoes, books, magazines, music -- that reflects their city style."<br /> </td>\n</tr></tbody></table><p><span style="color:#ff0000;"><!-- pagebreak --></span></p>\n<table style="width:100%;" border="0"><tbody><tr><td style="width:250px;"> </td>\n<td>10denza, from the Italian word meaning "trending," is complete with artfully arranged lounge areas, music listening stations and racks of clothing and accessories. Lanter hopes to eventually host art shows and social events.<br /><br />10denza is Lanter''s first retail business. A native of St. Louis, Lanter chose the Central West End area for its range of people, from children to retirees.<br /><br />"I traveled around to New York, Miami and Chicago looking for some new retail ideas, and I think the Central West End has an eclectic mix of professionals, students and families," Lanter says. "It''s a nice cross-section of the city."<br /><br />Customers can expect to find unique and hard to find shirts, shoes, sunglasses, gifts, books and music in a comfortable environment. The price range is across the board; shirts can range from $30 to $200.<br /><br />"We hope to continually change and wow customers with new items," Lanter said. "We want people to feel that when they come into 10denza it is more than just an exchange of tender for goods." <strong>A grand opening event is scheduled for September 29.</strong></td>\n</tr></tbody></table>', 1315572587, 1316541623, NULL, '0', NULL, '1', '0', '0', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 684, 0, 0),
(37, 3, 'Chris', 37, NULL, 'Third Annual CWE Window Walk', 'third-annual-cwe-window-walk', '<table style="width:100%;" border="0"><tbody><tr><td style="padding:4px 0;width:250px;vertical-align:top;text-align:center;" rowspan="3"><img style="margin-left:15px;margin-right:15px;" src="/tmp/uploads/public/propaganda%20images/SNOWFLAKE.jpg" alt="" width="317" height="379" /></td>\n<td style="border-bottom:1px solid #000;"><strong>We''re Decking the Halls in Style!</strong></td>\n</tr><tr><td style="padding:7px 0;"> </td>\n</tr><tr><td valign="top">\n<p>Join us this Saturday, December 1 for the Third Annual Central West End Window Walk. Check out our amazing holiday window display and get 20% off on regularly priced items at 10d and other participating merchants. It''s a day-long celebration including live entertainment, ice sculpting, chestnuts roasting, carriage rides and the most beautifully decorated windows in the city! Cast your vote for best window display (ours, of course), through December 22 and you could win $50 in CWE gift certificates.</p>\n<p><strong>Click <a title="CWE Scene" href="http://cwescene.com" target="_blank">here</a> for full event details.</strong></p>\n<p>Hope to see you!</p>\n</td>\n</tr></tbody></table><p><span style="color:#ff0000;"><br /></span></p>', 1354215335, 1354219660, 1354140000, '0', NULL, '1', '0', '1', 'a:5:{s:5:"title";s:0:"";s:11:"description";s:0:"";s:8:"keywords";s:0:"";s:6:"robots";s:0:"";s:6:"author";s:0:"";}', '[propaganda]', 'en', 'a:0:{}', 'default', 'default', 94, 0, 0),
